import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
    state: {
        favList:[]
    },
    mutations: {

        updatefavList(favList){
            state.favList=favList

        }
    },
    actions: {},
    getters:{
        favList: state=>state.favList
    }
})
